import styled from "styled-components";

export const FooterContainer = styled.footer`
  padding: 25px 50px;
  height: 100px;
`

export const NavigationContainer = styled.ul`
  list-style-type: none;
  text-align: center;
  li {
    margin-right: 25px;
    display: inline;
  }
`;
